					content=[[返生石原产于矿石之城，外表看起来似普通矿石般丑陋，剖开后可见少量绿色颗粒附着石心，能提炼原液入药。近年来返生石资源枯竭，其作为特殊药物需要报备使用，帝国禁止私挖私藏私运或买卖。]],
