				},
				[13]={
					chapter_last_action=[[]],
					content=[[矿石之城因出产矿物而闻名，过去这里也就是个没有名字的小镇。百年前，我的祖父因为看中这里艰苦的修行环境，修建了武馆，传到我这刚好第三代。]],
