					type=5,
					ui_mode=2,
					voice=0,
				},
				[14]={
					chapter_last_action=[[]],
					content=[[因为环境艰苦居民们过去都是以石建房，没有想到在山里挖出了矿物。其中一种就是拥有药效的返生石，矿石之城也依靠售卖返生石变得风光无量，繁华程度不输帝都，不像现在许多人嫌弃这里都搬走了！]],
					dialog_id=10100,
					dialogue_hide_action=[[]],
					finish_event=[[]],
					is_chapter_dialogue=0,
					last_action={},
