					voice=0,
				},
				[12]={
					chapter_last_action=[[]],
					content=[[工头拦着我不敢说，但是恩人你问了我肯定要说。其实采石场也不太安全，妖族的力量多大人族根本没有办法反抗，所以石料的破损是不可避免的。]],
