				[16]={
					chapter_last_action=[[]],
					content=[[听说矿石之城也不安全。我们觉得只要是偏远的地区，妖族就会来攻击人族。果然，人族就不应该心慈手软让妖族收到和人族一样的待遇！不信你问我们村长！]],
