				},
				[2]={
					chapter_last_action=[[]],
					content=[[听父亲说过，我们的祖先曾经是内陆的一只游牧民族，厌倦过去迁徙的生活，答应以看守上古封印为代价换得了月见岛的全部土地。因为月见岛极夜的缘故，岛上的食物十分匮乏。]],
