					voice=0,
				},
				[3]={
					chapter_last_action=[[]],
					content=[[每次村民使用的物资都是由我的父亲运输，我记得很清楚。月见岛每年都会大肆操办“欢庆日”，由村长迎接教会派去视察封印的特使。出事的那晚，也是“欢庆日”吧？
]],
