			[10228]={
				[1]={
					chapter_last_action=[[]],
					content=[[前辈知道教会圣女是什么吗？]],
					dialog_id=10228,
					dialogue_hide_action=[[]],
					finish_event=[[]],
					is_chapter_dialogue=0,
					last_action={},
					next=[[2]],
					pre_id_list=[[11201,0]],
					social_action_list=[[]],
					spine_ani_list=[[]],
					status=2,
					sub_talker_list=[[]],
					subid=1,
					type=4,
					ui_mode=2,
					voice=0,
				},
				[2]={
					chapter_last_action=[[]],
					content=[[说到圣女，不得不提起人类独立事件，跟今天的神父还有点关系。百年前，人族与妖族大战。为了与妖族强大的力量对抗，人族派出了所有精神异士。]],
					dialog_id=10228,
					dialogue_hide_action=[[]],
					finish_event=[[]],
					is_chapter_dialogue=0,
					last_action={},
					next=[[3]],
					pre_id_list=[[11201,0]],
					social_action_list=[[]],
					spine_ani_list=[[]],
					status=2,
					sub_talker_list=[[]],
					subid=2,
					type=5,
					ui_mode=2,
					voice=0,
				},
				[3]={
					chapter_last_action=[[]],
					content=[[何谓精神异士，你今天也体会到了，或者用现在的话来说，那就是精神能力者。而圣女，就是精神能力者的最上层，是为最高精神能力者。轮到你，圣女是上古妖族透露给你的？]],
					dialog_id=10228,
					dialogue_hide_action=[[]],
					finish_event=[[]],
					is_chapter_dialogue=0,
					last_action={},
					next=[[4]],
					pre_id_list=[[11201,0]],
					social_action_list=[[]],
					spine_ani_list=[[]],
					status=2,
					sub_talker_list=[[]],
					subid=3,
					type=5,
					ui_mode=2,
					voice=0,
				},
				[4]={
					chapter_last_action=[[]],
					content=[[……对。精神能力者到底是什么，他是人族，为什么从来没有听说过？]],
					dialog_id=10228,
					dialogue_hide_action=[[]],
					finish_event=[[]],
					is_chapter_dialogue=0,
					last_action={},
					next=[[5]],
					pre_id_list=[[11201,0]],
					social_action_list=[[]],
					spine_ani_list=[[]],
					status=2,
					sub_talker_list=[[]],
					subid=4,
					type=4,
					ui_mode=2,
					voice=0,
				},
				[5]={
					chapter_last_action=[[]],
					content=[[精神能力者即是人族中极少数能够拥有异能的人，本质上属于人族，因为数量极少被帝国视为最高机密。而我的理解是，帝国偷偷圈养了这样一批人，是作为最终兵器使用。你是不是跟妖族立过契约？]],
					dialog_id=10228,
					dialogue_hide_action=[[]],
					finish_event=[[]],
					is_chapter_dialogue=0,
					last_action={},
					next=[[6]],
					pre_id_list=[[11201,0]],
					social_action_list=[[]],
