					type=5,
					ui_mode=2,
					voice=0,
				},
				[10]={
					chapter_last_action=[[]],
					content=[[至于返生石实验，是指镇定剂滥用事件？据我游历听闻，人类独立事件为安抚伤者，大量使用返生石镇定剂，导致返生石矿产枯竭，如今只有在黑市花高价才能买到。]],
