					dialog_id=10201,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[这个简单，请问您叫]],
					dialog_id=10201,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[我叫许娇容，我弟弟叫许仙，他今天是去村里的私塾上课了，你可以去哪里找找看。]],
					dialog_id=10201,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[10202]={
				[1]={
					content=[[道长，请问有什么事吗？]],
					dialog_id=10202,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[与其说贫道有事找你，不如说小友是否有事要问贫道。]],
					dialog_id=10202,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[这个声音好熟悉啊……对了！是刚刚那个梦里的声音！]],
					dialog_id=10202,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[看来你还记得，贫道总算没有看走眼。]],
					dialog_id=10202,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[10203]={
				[1]={
					content=[[难道刚才的梦境，是道长的法术吗？]],
					dialog_id=10203,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[虽然是梦境，却也并非梦境，在星殿发生的事情是真的，贫道只不过让你用梦境体验了一番。]],
					dialog_id=10203,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[原来星殿被袭是真的，但我不明白，为什么要让我看这些？]],
					dialog_id=10203,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[很简单，星帝已经陨落，星殿不可一日无主，贫道奉命在人界寻找星帝的候选人，而小友正是人选之人。]],
					dialog_id=10203,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[你的意思是？要我接任成为新的星帝？]],
					dialog_id=10203,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[10204]={
				[1]={
					content=[[并非马上接任，星帝的候选者并非只有小友一人，能否在之后的选拔中胜出还是未知数。]],
					dialog_id=10204,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[然后为了在选拔中胜出，我还得付点香油钱对不对？]],
					dialog_id=10204,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[不相信也无妨，如今时辰尚早，小友且去寻得那位许仙，再作答复也不迟。]],
					dialog_id=10204,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[道长你怎么知道我在找许仙的？对了，刚刚那个许仙也出现在那个梦里了，难道？]],
					dialog_id=10204,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[许仙也是有仙缘之人，如今正在仙途的关口上，小友不妨去帮他一把，或许自己也会有所感悟。]],
					dialog_id=10204,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[10301]={
				[1]={
					content=[[方才那老道和你有说有笑，你们绝对是一伙的，你得赔我梨钱！]],
					dialog_id=10301,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[我说大哥，你抓着我也没用啊，我家里也是穷得叮当响，再不回家吃饭，我姐就要拿鸡毛掸子抽我嘞。]],
					dialog_id=10301,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[50302]],
					status=0,
					subid=2,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[我不管！我一年头就靠着一车梨弄点钱过年，现在全没了！要是还不上钱，我就把你绑到山上去卖了。]],
					dialog_id=10301,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[快住手！]],
					dialog_id=10301,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[10302]={
				[1]={
					content=[[别打了，别打了，我认输了。]],
					dialog_id=10302,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[50301]],
					status=0,
					subid=1,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[饶了他吧，他也是个可怜人，一年到头的功夫全部白费了，换作我也会很生气的。]],
					dialog_id=10302,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[的确也是，话说到底怎么回事？]],
					dialog_id=10302,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[说来也是奇怪，方才有一个老道士想讨个梨吃，我看他可怜就给他买了一个，没想到老道突然变了个戏法，变出了一棵梨树，路人都纷纷抢着摘，等人散去才发现，原来那一树的梨其实就是大哥车上的梨。]],
					dialog_id=10302,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[你这么说来，那位老道是真的仙人了。]],
					dialog_id=10302,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[怎么都好，我想去帮大哥把梨钱都要回来，你就好人做到底来帮帮我把。]],
					dialog_id=10302,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[10303]={
				[1]={
					content=[[各位乡亲父老们行行好吧，这位大哥上有大下有小，就靠这么一车梨子图点小钱过个小年，大家就行行好，把这位大哥的血汗钱还回来吧。]],
					dialog_id=10303,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[被你这娃娃说得也不好意思了，这是我的份，给你吧。]],
					dialog_id=10303,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[我看到我家那位偷偷拿了，这里是他的份。]],
					dialog_id=10303,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[50305]],
					status=0,
					subid=3,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[虽然我没拿，不过没有阻止的我也有责任，也算我一份吧。]],
					dialog_id=10303,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[50306]],
					status=0,
					subid=4,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[谢谢了，谢谢各位乡亲们了]],
					dialog_id=10303,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[10304]={
				[1]={
					content=[[太谢谢你们了，这些钱比我往年卖的还多，真是太谢谢两位兄弟了。]],
					dialog_id=10304,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[不用，不用，这本来就有我的责任。]],
					dialog_id=10304,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[50302]],
					status=0,
					subid=2,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[然而最关键的那个老道却不见了，一定是心有愧疚，不好意思出来了。]],
					dialog_id=10304,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[被两个娃娃这么说，老道我再不现身，脸皮就挂不住了。]],
					dialog_id=10304,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[50307]],
					status=0,
					subid=4,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[哎哟，老道还好意思出来，现在都正午了，我姐估计都等得气炸了，等会回去我肯定屁股开花，你倒是给我负责啊。]],
					dialog_id=10304,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[50302]],
					status=0,
					subid=5,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[好好好，老道自然会负责，我这有一本修道的秘籍，你要是能悟通，别说鸡毛掸子了，就是真刀真枪也未必能伤你分毫。]],
					dialog_id=10304,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[50307]],
					status=0,
					subid=6,
					type=3,
					ui_mode=2,
					voice=0,
				},
			},
			[10401]={
				[1]={
					content=[[从这本书上能感觉到很明显的仙气，那位老道看似瘦弱，却是位真仙人啊]],
					dialog_id=10401,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[是吗？为什么我什么都感觉不到。]],
					dialog_id=10401,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[你全身上下没有一点灵力，当然感觉不到，若你能真正地加入修行者行列，肯定就能感觉到了。]],
					dialog_id=10401,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[被你这么一说，我觉得自己还真得修修仙看了。]],
					dialog_id=10401,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[先别说这个，我们再不回去，别说午饭了，晚饭都别想吃了。]],
					dialog_id=10401,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[对啊，快走快走。]],
					dialog_id=10401,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[10402]={
				[1]={
					content=[[许仙你可以啊，我在这里等了又等，把饭菜热了又热，你们却去玩泥巴？我看你们吃泥巴算了？]],
					dialog_id=10402,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[大姐你别气，事情是这样的（将许仙的遭遇悉数道出）]],
					dialog_id=10402,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[唉……许仙这孩子就是太善良，从小到大都不知道因为这个吃多少亏了，就是不学乖……]],
					dialog_id=10402,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[姐，好人自有好报，你从小不是就这么教我的吗，你看，这次我还得到了一本仙书呢。]],
					dialog_id=10402,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[50302]],
					status=0,
					subid=4,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[这种书有什么用啊，你要是真有心上进，就好好复习功课，早日考取功名，姐也好安下这颗心。]],
					dialog_id=10402,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[傻孩子，找了婆家的日子也不一定比现在好多少，你有这份心姐就很开心了，来来，先别说了，快吃饭吧。]],
					dialog_id=10402,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[真是一对让人羡慕的好姐弟啊。]],
					dialog_id=10402,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[10403]={
				[1]={
					content=[[厉害厉害，我就知道少侠其实也是修道中人，果然实力不同凡响。]],
					dialog_id=10403,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[许仙我问你，你真的打算修仙吗？我看你吃完饭就一直抱着那本书在看。]],
					dialog_id=10403,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[神仙谁不想当呢，哪怕是皇帝，也终有归土的一天，但是神仙就不一样了，就凭这点就让人很向往了吧。]],
					dialog_id=10403,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[那样的神仙到底有什么意义呢，只为了自己的长生，耗尽天地间的各种灵宝。]],
					dialog_id=10403,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[这么复杂的问题，你问我也回答不了啦，既然你有这种疑问，不妨亲自去寻找答案吧。]],
					dialog_id=10403,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[真是一语惊醒梦中人，我有事要离开了，今日你们姐弟对我的照顾，我会谨记的。]],
					dialog_id=10403,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[好，我们有缘再见吧。]],
					dialog_id=10403,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[10404]={
				[1]={
					content=[[小友你终于来了，答复是什么？]],
					dialog_id=10404,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[虽然还没想明白，但我接受星帝储君的试炼，也许在这个过程中我会想通也不一定。]],
					dialog_id=10404,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[小友果然很有潜质，我期待着那天的到来，拿着这个（道人递来一道符）]],
					dialog_id=10404,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[这是什么？]],
					dialog_id=10404,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[小友现在修为尚浅，还没有进入天庭的资格，带着这个先回门派再好好修炼几年，待到我认为时机成熟，我会通过这道符找到小友。]],
					dialog_id=10404,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[好，那我便动身回师门了，我们就此别过。]],
					dialog_id=10404,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[恩，再会。]],
					dialog_id=10404,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[11101]={
				[1]={
					content=[[徒儿在师门潜修的这段时间，修为增长十分迅速，再继续留在师门也难再有所长进，为师建议你去人界游离一番。]],
					dialog_id=11101,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[弟子正有此意。]],
					dialog_id=11101,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[但也不能让你就这样离开，这样吧，只要你能通过为师的三个考验，为师便给你一点东西作为出师礼物。]],
					dialog_id=11101,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[好，一言为定哦。]],
					dialog_id=11101,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11102]={
				[1]={
					content=[[第一场试炼很简单，就当是热热身吧。]],
					dialog_id=11102,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[请赐教。]],
					dialog_id=11102,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11103]={
				[1]={
					content=[[第二场试炼的难度会有所提升，准备好了吗？]],
					dialog_id=11103,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[准备好了，来吧。]],
					dialog_id=11103,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11104]={
				[1]={
					content=[[第三场试炼会比较难，你最好先把自己的技能提升一下。]],
					dialog_id=11104,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[知道了，我会全力以赴的。]],
					dialog_id=11104,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11105]={
				[1]={
					content=[[很好，不愧是本门最出色的弟子，这是你的出师礼物，出门在外，也别忘了每天回师门看看，帮忙做做师门任务啊。]],
					dialog_id=11105,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[知道了，师傅，我会常回来看看的，那我出发了。]],
					dialog_id=11105,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[行，去吧。]],
					dialog_id=11105,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[11201]={
				[1]={
					content=[[恭喜小友出师了。]],
					dialog_id=11201,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[原来是吕道长，这一别已经三年，还以为道长已经忘记我了呢。]],
					dialog_id=11201,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[怎么会，小友可是星帝储君之身，若有朝一日能接任星帝大统，便是贫道也要称臣，又怎么敢忘记。]],
					dialog_id=11201,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[看来道长此次前来，不仅仅是来祝贺这么简单吧。]],
					dialog_id=11201,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[如小友所料，三年前魔教令星帝陨落，在修行界的影响力瞬间暴涨，很多对天庭抱有敌意的修行者纷纷加入魔教，天庭对此也是疲于应对。]],
					dialog_id=11201,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[修行界的混乱会自然地影响到人界，看来我作为储君的第一份工作要来了，直接告诉我吧，我应该做什么？]],
					dialog_id=11201,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[小友且先到杭州，自然就会知道该怎么做了。]],
					dialog_id=11201,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[11202]={
				[1]={
					content=[[杭州城不愧为江南的经济重镇，繁华程度比京城有过之而无不及啊。]],
					dialog_id=11202,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[这是当然的，客官可知道，潘王府的所在，那位大人可是与当朝第一权臣梁王对抗的大人啊。]],
					dialog_id=11202,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[朝政我不怎么懂，但听起来的确很厉害。]],
					dialog_id=11202,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[那是，不仅如此，杭州还是觐天书院的所在地，且不说当朝太傅王文会大人曾在书院任教，单说王大人的学生许仙，就是江南一带有名的才子，诗词上的造诣堪称当世大家，就连一些大学士都自愧不如。]],
					dialog_id=11202,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[（许仙？几年不见那家伙居然这么厉害了，刚好我也到了杭州，先去找他聚一聚吧。）]],
					dialog_id=11202,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[请问觐天书院怎么去啊？]],
					dialog_id=11202,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[客官想去觐天书院吗？很容易找的，就在王府东面。]],
					dialog_id=11202,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[11203]={
				[1]={
					content=[[……怎么大白天有个小女孩倒在路中间？]],
					dialog_id=11203,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[咕~咕~（肚子叫的声音）]],
					dialog_id=11203,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[这声音……难道是饿晕了？]],
					dialog_id=11203,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[小女孩突然抬起头看着你。]],
					dialog_id=11203,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[你看着她。]],
					dialog_id=11203,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[她看着你。]],
					dialog_id=11203,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[你身上有许仙的味道！一定是许仙的朋友！快带我吃饭！]],
					dialog_id=11203,
					finish_event=[[]],
					last_action={},
					next=[[8]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[8]={
					content=[[哈？你说啥？喂喂，我可不是食物，别咬我啊！]],
					dialog_id=11203,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=8,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11204]={
				[1]={
					content=[[你这是什么鼻子啊，虽然我身上带着娇容姐给的护身符，但那都是三年前的东西了，这你都闻得出来。]],
					dialog_id=11204,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[包砸，好次~（包子，好吃）]],
					dialog_id=11204,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[吃慢点啊，又没人跟你抢，别噎着了。]],
					dialog_id=11204,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[话说你修行者啊？修为好像比许仙高很多，为什么会跟那种家伙做朋友的？]],
					dialog_id=11204,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[这么说来你也是修行者吗？现在修行者都是大白菜吗？小孩子都能修。]],
					dialog_id=11204,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[什么小孩子，我的年龄都能当你的奶奶的奶奶了。]],
					dialog_id=11204,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[这么说来……你是妖？不，龙族？]],
					dialog_id=11204,
					finish_event=[[]],
					last_action={},
					next=[[8]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[8]={
					content=[[嘿嘿，算你有眼光，本姑娘就是西湖的水君，未来的长江水神，敖璃。]],
					dialog_id=11204,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=8,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[11205]={
				[1]={
					content=[[看你自信的挺起小胸板实在不忍打击你，但西湖跟长江比简直是蚂蚁跟大象，你可以先定个比较小的目标吗。]],
					dialog_id=11205,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[比如先赚它一个亿？]],
					dialog_id=11205,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[这么大口气？你知道一个亿有几个零吗？]],
					dialog_id=11205,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[那个……那个……有1,2,3,4，5,6……（数手指）]],
					dialog_id=11205,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[有空多学学算数吧，你看这多丢人啊。]],
					dialog_id=11205,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[吵、吵死了，本姑娘不过是一时反应不过来而已，怎么你和许仙都总爱管这些闲事啊，有空还不如多给我买几笼包子。]],
					dialog_id=11205,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[你都吃了五大笼了，还吃，总之先带我找到许仙再说，找到了我让许仙再请你吃几笼。]],
					dialog_id=11205,
					finish_event=[[]],
					last_action={},
					next=[[8]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[8]={
					content=[[你傻啊，我要是知道会饿晕在书院门口吗？……等等，那边的不就是大混蛋许仙吗？]],
					dialog_id=11205,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=8,
					type=2,
					ui_mode=2,
					voice=0,
				},
			},
			[11206]={
				[1]={
					content=[[各位大哥，虽然我知道你们缺钱花，但你来堵我们这种穷书生也太饥不择食了吧，不过你要是觉得我的诗能卖个好价钱，我也不妨赠你两句。]],
					dialog_id=11206,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[你个穷书生一边凉快去，谅你也掏不出几个子，倒是旁边这位，就是腰上的玉佩都价值连城，让他跟我们走一趟吧。]],
					dialog_id=11206,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[51208]],
					status=0,
					subid=2,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[一群乌合之众，趁我还没动怒，赶紧滚！]],
					dialog_id=11206,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[51209]],
					status=0,
					subid=3,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[臭小子这么嚣张？弟兄们给我教训教训他！]],
					dialog_id=11206,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[51208]],
					status=0,
					subid=4,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[许仙有麻烦，我们赶紧去帮忙。]],
					dialog_id=11206,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11207]={
				[1]={
					content=[[可恶，这小子的帮手好厉害，你们等着，这事没完。]],
					dialog_id=11207,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[51208]],
					status=0,
					subid=1,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[哎哟，你怎么来了，好些年不见，你怎么变得这么厉害了。]],
					dialog_id=11207,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[你也不赖啊，几年不见都混成大才子了，想来也没必要修什么仙了，走仕途不是更加好吗？何况你还有贵人相助。]],
					dialog_id=11207,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[贵人一词实在是抬煞我也，在下潘玉，与许仙是书院同学，不知阁下是？]],
					dialog_id=11207,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[51209]],
					status=0,
					subid=4,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[我是许仙的朋友，此来杭州办事，突然听到许仙成为了觐天书院学生，特来相聚。]],
					dialog_id=11207,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[既然你是远道而来，那我就必须尽一下地主之谊了，带你好好游览一下这杭州的美景，潘玉你先回去等我把。]],
					dialog_id=11207,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[也好，三年不见，我也有一堆话想要问你呢，我们就边走边说吧。]],
					dialog_id=11207,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11301]={
				[1]={
					content=[[你看，这就是我们杭州最负盛名的酒家“望月楼”，这里听说从来只接待达官贵人，一般的有钱人可是有钱都进不去的。]],
					dialog_id=11301,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[你特意带我来这种奢侈地方，是想带我进去呢，还是只看一眼。]],
					dialog_id=11301,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[当然是看一眼，我许仙可是贫寒出身，哪来闲钱来这种奢侈地方。]],
					dialog_id=11301,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[你现在的身价加上你的那位好朋友，我感觉你现在进去这不是什么问题。]],
					dialog_id=11301,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[太瞧得起我了，当今世道，只要还没有金榜题名，一切都无从谈起。至于潘玉嘛，君子之交淡如水，我又怎能有那种非分之想。]],
					dialog_id=11301,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[是吗？但我瞧得出来，那位潘公子对你可不一般啊。喂，许仙你愣愣地看着那边干嘛？]],
					dialog_id=11301,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11302]={
				[1]={
					content=[[你好，这位公子，请问往西湖方向怎么走呢？]],
					dialog_id=11302,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[西、西湖嘛，很简单，沿着这条大道一直走，就能到了]],
					dialog_id=11302,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[51301]],
					status=0,
					subid=2,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[谢公子，那小女子先告辞了。]],
					dialog_id=11302,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[等、等等……]],
					dialog_id=11302,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[51301]],
					status=0,
					subid=4,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[请问公子还有什么事吗？]],
					dialog_id=11302,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[我……]],
					dialog_id=11302,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[51301]],
					status=0,
					subid=6,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[臭小子，你果然还在啊，本大爷这次叫齐了弟兄，看你还往哪跑。]],
					dialog_id=11302,
					finish_event=[[]],
					last_action={},
					next=[[8]],
					pre_id_list=[[51208]],
					status=0,
					subid=7,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[8]={
					content=[[那帮混混还真是不吸取教训啊，姑娘你先退下，让我来应付。]],
					dialog_id=11302,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=8,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11303]={
				[1]={
					content=[[可恶这小子不是一般的强，你们给我记住，等我家楚老大来了，你们都别想跑。]],
					dialog_id=11303,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[51208]],
					status=0,
					subid=1,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[他们还真打算轮番上阵啊，能不能一次性全来了啊，他们不烦我也烦了。]],
					dialog_id=11303,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[姑娘，你没伤着吧？]],
					dialog_id=11303,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[我没事，倒是公子，你的手臂受伤了]],
					dialog_id=11303,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[51302]],
					status=0,
					subid=4,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[这点小伤不碍事。]],
					dialog_id=11303,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[那怎么行，来，我用这块手帕给你包扎一下。]],
					dialog_id=11303,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[51302]],
					status=0,
					subid=6,
					type=3,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[那……好吧，回头我把手帕洗干净还给你，不知道我能在哪找到你呢？]],
					dialog_id=11303,
					finish_event=[[]],
					last_action={},
					next=[[8]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[8]={
					content=[[如果你想找到我，来城外的玄机观便是。]],
					dialog_id=11303,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[51302]],
					status=0,
					subid=8,
					type=3,
					ui_mode=2,
					voice=0,
				},
			},
			[11304]={
				[1]={
					content=[[看把你销魂的，不就是手帕吗，至于像是传家之宝一样盯着啊？谁会来偷你的啊。]],
					dialog_id=11304,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[当然要看好了一点，我还要还给那位姑娘的，要是不小心被偷走了，我怎么交代啊？]],
					dialog_id=11304,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[我看啊，在手帕被偷走前，你的心就已经先被捎走喽。]],
					dialog_id=11304,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[少说风凉话了，今天有些煞风景的人来捣乱，也没怎么玩够，怎么样，明儿我们去城外兜兜风？]],
					dialog_id=11304,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[哎哟，想去见人家姑娘就直接点说嘛。]],
					dialog_id=11304,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[是顺便！顺便！顺便把手帕换给人家，你看着手帕手工多精致，怕是人家最喜欢的，怎能让人家割爱。]],
					dialog_id=11304,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[真是怕了你了，去就去吧。]],
					dialog_id=11304,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11401]={
				[1]={
					content=[[我就在附近逛逛，你自己去把手帕还了吧。]],
					dialog_id=11401,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[这样，那我自己去了，一会我们在望月楼碰面吧。]],
					dialog_id=11401,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[（连后面有人跟踪我们都不知道啊，估计又是那帮混混。唉，没办法，为了这小子的美好幸福，只能让我来当一回雷锋了。）]],
					dialog_id=11401,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11402]={
				[1]={
					content=[[姑娘鬼鬼祟祟地跟我了我们很久了，是有什么事情吗？]],
					dialog_id=11402,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[……别碍事，我要宰了那个叫许仙的家伙。]],
					dialog_id=11402,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[这是多大仇，虽然我不知道那家伙怎么得罪了姑娘，但今天能不能先饶了他，改天再来我定不会阻拦。]],
					dialog_id=11402,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[就是今天才不行，你别妨碍我，不然连你一块宰了。]],
					dialog_id=11402,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[唉，看来我也只能舍命陪君子了。]],
					dialog_id=11402,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
			[11403]={
				[1]={
					content=[[好厉害的修为，为什么连你也要帮着那种家伙，那种家伙到底有什么好的？]],
					dialog_id=11403,
					finish_event=[[]],
					last_action={},
					next=[[2]],
					pre_id_list=[[0]],
					status=0,
					subid=1,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[2]={
					content=[[许仙的姐姐对我有恩，况且在这世道上，他的确算是难得的好人了。]],
					dialog_id=11403,
					finish_event=[[]],
					last_action={},
					next=[[3]],
					pre_id_list=[[0]],
					status=0,
					subid=2,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[3]={
					content=[[我不信，那不过是个勾引我姐姐大坏蛋，还用什么前世之恩的话来骗人，一定不是什么好东西？]],
					dialog_id=11403,
					finish_event=[[]],
					last_action={},
					next=[[4]],
					pre_id_list=[[0]],
					status=0,
					subid=3,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[4]={
					content=[[前世之恩？那是什么意思？]],
					dialog_id=11403,
					finish_event=[[]],
					last_action={},
					next=[[5]],
					pre_id_list=[[0]],
					status=0,
					subid=4,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[5]={
					content=[[你还装，姐姐说那个许仙就是千年前救了她性命的小牧童转世，说自己要报答千年前的救命之恩，这才千里地来到杭州。]],
					dialog_id=11403,
					finish_event=[[]],
					last_action={},
					next=[[6]],
					pre_id_list=[[0]],
					status=0,
					subid=5,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[6]={
					content=[[千年前？难怪我看那姑娘第一眼就觉得怪怪的，原来真的是妖，而且还是千年修为的。]],
					dialog_id=11403,
					finish_event=[[]],
					last_action={},
					next=[[7]],
					pre_id_list=[[0]],
					status=0,
					subid=6,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[7]={
					content=[[哼，天下修仙者都一样，不过是些道貌岸然的伪君子，一听到是妖就脸色都变了。]],
					dialog_id=11403,
					finish_event=[[]],
					last_action={},
					next=[[8]],
					pre_id_list=[[0]],
					status=0,
					subid=7,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[8]={
					content=[[姑娘误会了，我倒没有这意思，但只怕我的朋友不是这么想，也怕因为这个让你姐姐受伤害。]],
					dialog_id=11403,
					finish_event=[[]],
					last_action={},
					next=[[9]],
					pre_id_list=[[0]],
					status=0,
					subid=8,
					type=1,
					ui_mode=2,
					voice=0,
				},
				[9]={
					content=[[那你说怎么办？]],
					dialog_id=11403,
					finish_event=[[]],
					last_action={},
					next=[[10]],
					pre_id_list=[[0]],
					status=0,
					subid=9,
					type=2,
					ui_mode=2,
					voice=0,
				},
				[10]={
					content=[[没办法，只好由我来当这个恶人了。]],
					dialog_id=11403,
					finish_event=[[]],
					last_action={},
					next=[[0]],
					pre_id_list=[[0]],
					status=0,
					subid=10,
					type=1,
					ui_mode=2,
					voice=0,
				},
			},
		},
